    <div class="login-container">
        <div class="login-form">
            <div class="container"> 
                <form id="login-form">
                    <div class="avatar__img">
                        <img src="./assets/image/Artboard 1-8.png" alt="">
                    </div>
                    
                    <h4>Welcome Back — Please Log In</h4>
                  
                    <div class="input-item">
                        <p>Email Or Username</p>
                        <input type="email" id="email" required> </div>

                    <div class="input-item">
                        <p>Password</p>
                        <input type="password" id="password" required> </div>

                    <button type="submit">Login</button> <div id="error-message" style="color: red; text-align: center; margin-top: 10px;"></div> <span>Don't have an account? <a href="">Create An Account</a></span>
                </form>
                <div style="text-align: center; margin-top: 20px;">
                                      <img src="./assets/image/logo-2 (2).webp" alt="" style="height: 48px;" class="proedge0logo">

                </div>
            </div>
          
        </div>
        <div class="login-bg">
            <div id="lottie-container"></div>
        </div>
    </div>

        // Add the login functionality
        document.addEventListener('DOMContentLoaded', function() {
            const loginForm = document.getElementById('login-form');
            const emailInput = document.getElementById('email');
            const passwordInput = document.getElementById('password');
            const errorMessage = document.getElementById('error-message');

            // Check if user is already logged in
            if (sessionStorage.getItem('isLoggedIn') === 'true') {
                window.location.href = 'index.html';
            }

            loginForm.addEventListener('submit', function(event) {
                event.preventDefault();

                const username = emailInput.value.trim();
                const password = passwordInput.value.trim();

                // Hardcoded username and password
                const validUsername = 'nree@gmail.com'; 
                const validPassword = '123'; 

                if (username === validUsername && password === validPassword) {
                    sessionStorage.setItem('isLoggedIn', 'true');
                    window.location.href = 'index.html';
                } else {
                    errorMessage.textContent = 'Invalid email or password. Please try again.';
                }
            });
        });
